import React, { Component } from "react";
import { FaSearch} from 'react-icons/fa';
import { MdLocationOn } from 'react-icons/md';

class Home extends Component {
  state = {};

  render() {
    return (
      <div style={styles.mainStyle}>
        <div style={styles.boxStyle} > 
        <MdLocationOn size='5em' />
           <FaSearch size='4em'/>
        </div>
      </div>
    );
  }
}

const styles = {
  mainStyle: {
    display: "flex",
    alignItems: 'center',
    margin: "1.6%",
    marginLeft: '15%',
    marginRight: '15%',
    flexDirection: 'column'
  },
  boxStyle: {
    display: 'flex',
    //alignItems: 'center',
    flexDirection: 'row',
    height: 80,
    borderRadius: 6,
    padding: '2%',
    justifyContent: 'space-between',
    boxShadow: "1px 4px 8px 1px #9E9E9E",
    //border: "1px solid black",
    width: '100%',
  }
};

export default Home;
